import React from "react"

class PrikazKarte extends React.Component{

    constructor(){
        super()
        this.state = {
            projekcija:""
        }
    }

    componentDidMount(){
        this.setState({projekcija:this.props.projekcija})
        const config={
            headers: new Headers({'Authorization': 'Bearer ' + localStorage.getItem('jwt')},
                                  {'Access-Control-Allow-Methods':'GET'}),
          };

        fetch('http://localhost:8080/bioskop/filmovi/'+this.props.projekcija.film+"/"+zanr+"/"+idOd+"/"+idDo+"/"+dist+"/"+zemlja+"/"+idGodOd+"/"+idGodDo+"/"+sort,config)
            .then(res => res.json())
            .then(res => {
                this.setState({
                    filmovi: res
                })
            })
    }

    render(){
        return(
            <div>
                <h1>Prikaz karte!</h1>
            </div>
        )
    }
}

export default PrikazKarte
